import React, { Component } from 'react'

export class about extends Component {
  render() {
    return (
      <div>
        <Link to={{ pathname: "https://www.instagram.com/p/CrwZ4nfLNgd/"}} target="blank">Here more about us</Link>
      </div>
    )
  }
}

export default about
